import React, {Component} from 'react';

class Foodtit extends Component {

    componentWillMount(){
        this.setState({
            tit:this.props.tit
        })
    }
    //返回上一页函数
    back=()=>{
        window.history.go(-1)
    }
    render() {
        return (
            <div className="head">
                <span className="iconfont icon-jiantou" onClick={this.back}></span>
                {/*根据路由的动态值来决定添加哪一个值*/}
                {this.state.tit[this.props.index]}
            </div>
        );
    }
}

export default Foodtit;
